import Vue from 'vue'
import App from './App.vue'
import VueLazyload from 'vue-lazyload'

Vue.use(VueLazyload, {
  loading: require('@/assets/loading-spinner.gif') // Imagem de carregamento
})

new Vue({
  render: h => h(App),
}).$mount('#app')
